import styled from 'styled-components'
import Image from 'next/image'

const HomeContainer = () => {

    return (
        <Container>
            <h1>teste</h1>
            <Img>
                <Image
                    src="/coding.png"
                    alt="Coding image"
                    layout="fill"


                />
            </Img>
        </Container>
    )

}

const Container = styled.div`
    display: flex;
    flex-direction: column;
`
const Img = styled(Container)`
    max-width: 800px;
    max-heigh: 800px;
`

export default HomeContainer
